import React, { Component } from 'react';
import Header from './header';
import Corousal from './Corousal';
import Footer from './Footer'

class App extends Component {
  render() {
    return (
      <div>
        <Header />,
      <Corousal />,
      <Footer />
      </div>
    );
  }
}

export default App;
